import mathimport redef func1(m, n):    if m <= 1 or n <= 1:        return None    for i in range(2, n + 1):        if n % i == 0 and m % i == 0:            return False    return Truedef func2(L):    if len(L) == 0 or len(L) == 1:        return 0    cnt = 0    for i in range(len(L)-1):        for j in range(i+1, len(L)):            if L[i] > L[j]:                cnt += 1    return cnt    def func3(mat1, mat2):    m, d, n = len(mat1), len(mat2), len(mat2[0])    mm = [[None for i in range(n)] for j in range(m)]    for i in range(m):        for j in range(n):            val = 0            for k in  range(d):                val += mat1[i][k] * mat2[k][j]            mm[i][j] = val    return mmdef func4(lst1):    length = len(lst1)    n = int(math.sqrt(length))    result = [lst1[i*n:(i+1)*n] for i in range(n)]    return resultdef func5(sentence):    words=sentence.split()    dict1=dict.fromkeys(set(words),0)    for word in dict1.keys():        dict1[word]=words.count(word)    res=sorted(dict1.items(),key=lambda temp:(temp[1],temp[0]), reverse=True)    lst=[]    for i in range(len(res)):        lst.append(res[i][0])        if i>=2:break    return lst    def func6(S, T):    ss = set(S)    ts = set(T)    a = ss & ts    b = ss - ts    c = ts - ss    return (len(a), len(b), len(c))            def BitsAverage(Num):    t=[int(ch) for ch in str(Num)]    res=sum(t)/len(t)    return resdef func7(s):    d={}    s=s.upper()    for ch in s:        d[ch]=d.get(ch,0)+1    temp=list(d.items())    temp.sort(key=lambda x:x[1],reverse=True)    return list(temp[0])def func8(s):    p=re.compile(r'\d{3,5}')    res=p.findall(s)    if res:        res=[int(i) for i in res]        res.sort(key=lambda x:BitsAverage(x), reverse=True)        return res    else:        return Noneif __name__ == "__main__":    print(func1(0, -1))    # print(func1(2, 3))    # print(func1(33, 50))    # print(func1(50, 33))   